// SPDX-License-Identifier: MIT
pragma solidity 0.8.19;

contract give{
    struct proposal{
        uint id;
        string description;
        uint request;
        uint amount;
        address payable receipient;
        bool isExecuted;
        bool requestSatisfied;
    }
    struct investor{
        uint256 id;
        address payable investorAddress;
        uint256 amountContributed;
    }


    uint256 public nextProposalId=1;
    uint256 public investorId=1;
    address public manager;
    mapping(uint256=>proposal) public proposals;
    mapping(uint256=>investor) public investors;
    mapping(uint256=>proposal[])public investmentList;

    constructor(){
        manager=msg.sender;
    }
    modifier onlyManager(){
        require(manager==msg.sender,"You are not an Manager");
        _;
    }


    function createProposal(string calldata description,uint request, address payable receipient)public{
        proposals[nextProposalId]=proposal(nextProposalId,description,request,0,receipient,false,false);
        nextProposalId++;
    }
    function investorRegistor(address payable _add)public {
        require(investorVerification(msg.sender),"Address already registered");
        investors[investorId]=investor(investorId,_add,0);
        investorId++;
    }
    function investorVerification(address _person)internal view returns(bool){
        for(uint i=1;i<investorId;i++){
            if(investors[i].investorAddress==_person){
                return false;
            }
        }
        return true;  
    }


    function contribution(uint256 iId,uint256 _id,uint256 _a) public payable {
        require(proposals[_id].request>=proposals[_id].amount
        && proposals[_id].isExecuted==false,"Proposal has been executed");
        require(_a>0,"Send more than 0 ether");

        if(proposals[_id].amount+_a==proposals[_id].request){
                proposals[_id].amount=proposals[_id].request;
                proposals[_id].requestSatisfied=true;
                proposals[_id].isExecuted=true;
        }else{
            proposals[_id].amount+=_a;
        }
        investmentList[iId].push(proposals[_id]);
        investors[iId].amountContributed+=_a;
    }

    function _transfer(uint256 _id,address payable receipient)public  payable onlyManager(){
        receipient.transfer(proposals[_id].amount);
    }


    function proposalList()public view returns(proposal[] memory){
        proposal[] memory array=new proposal[](nextProposalId);
        for(uint i=1;i<nextProposalId;i++){
            array[i-1]=proposals[i];
        }
        return array; 
    }
    function investorList()public view returns(investor[] memory){
        investor[] memory array=new investor[](investorId);

        for(uint i=1;i<investorId;i++){
            array[i-1]=investors[i];
        }
        return array; 
    }

}
